    ('Términos y Condiciones v1.0 - Lanzamiento Inicial',
     N'VERSIÓN 1.0 - LANZAMIENTO (01/01/2023)

Bienvenido a BiciGo, la plataforma líder de alquiler de bicicletas en Latinoamérica y España.

ACEPTACIÓN DE TÉRMINOS:
Al acceder y usar BiciGo, aceptas estos Términos y Condiciones en su totalidad. Si no estás de acuerdo, no puedes usar el servicio.

DESCRIPCIÓN DEL SERVICIO:
BiciGo proporciona acceso a un sistema de alquiler de bicicletas compartidas en múltiples ciudades. Los usuarios pueden alquilar bicicletas por horas, días o períodos extendidos.

RESPONSABILIDADES DEL USUARIO:
1. Proporcionar información veraz y actualizada
2. Usar las bicicletas de forma responsable y segura
3. Respetar todas las normas de tránsito vigentes
4. Reportar inmediatamente cualquier daño o mal funcionamiento
5. Devolver la bicicleta en buen estado

RESPONSABILIDAD POR DAÑOS:
El usuario es responsable de cualquier daño causado por uso negligente o indebido. Los daños por desgaste normal están cubiertos por BiciGo.

CANCELACIONES Y REEMBOLSOS:
Las cancelaciones se procesarán de acuerdo con la política vigente en la fecha de la transacción.

LIMITACIÓN DE RESPONSABILIDAD:
BiciGo no es responsable por pérdidas indirectas, incidentes o daños consequentes.',
