-- NOTA: Supongamos que van del 2601 al 2860. AJUSTA LOS VALORES ABAJO SEGÚN TUS DATOS.

-- PASO 2: Ejecuta esto para asignar 2 contactos a cada punto
DECLARE @minID INT = 3650;  -- CAMBIAR AL ID MÍNIMO REAL
DECLARE @maxID INT = 3909;  -- CAMBIAR AL ID MÁXIMO REAL

CREATE TABLE #temp_contactos (
    row_num INT,
    id_persona INT
);

SELECT ROW_NUMBER() OVER (ORDER BY id_persona) as row_num, id_persona
FROM persona
WHERE id_persona >= @minID AND id_persona <= @maxID
ORDER BY id_persona;

SELECT 
    tc.id_persona,
    ((tc.row_num - 1) / 2) + 1 as id_punto_alquiler,
    CASE (tc.row_num % 12)
        WHEN 1 THEN 'Gerente de Punto'
        WHEN 2 THEN 'Administrador Local'
        WHEN 3 THEN 'Coordinador de Reservas'
        WHEN 4 THEN 'Asistente de Atención'
        WHEN 5 THEN 'Supervisor de Punto'
        WHEN 6 THEN 'Ejecutivo de Servicio'
        WHEN 7 THEN 'Encargado de Inventario'
        WHEN 8 THEN 'Recepcionista'
        WHEN 9 THEN 'Agente de Atención'
        WHEN 10 THEN 'Jefe de Operaciones'
        WHEN 11 THEN 'Operario'
        ELSE 'Personal de Limpieza'
    END as cargo,
    CASE (tc.row_num % 9)
        WHEN 0 THEN NULL
        WHEN 1 THEN '08:00 - 17:00 Lunes a Viernes'
        WHEN 2 THEN '07:00 - 16:00 Lunes a Viernes'
        WHEN 3 THEN '09:00 - 18:00 Lunes a Sábado'
        WHEN 4 THEN '08:00 - 17:00 Lunes a Sábado'
        WHEN 5 THEN '10:00 - 19:00 Martes a Domingo'
        WHEN 6 THEN '06:00 - 15:00 Lunes a Viernes'
        WHEN 7 THEN '14:00 - 22:00 Lunes a Viernes'
        ELSE '08:00 - 20:00 Lunes a Sábado'
    END as horario_disponible
FROM #temp_contactos tc;

DROP TABLE #temp_contactos;
