-- Asegurar que capacidad_total >= bicicletas reales
UPDATE c
SET capacidad_total = t.total_bicicletas
FROM capacidad c
JOIN (
    SELECT id_punto_alquiler, COUNT(*) AS total_bicicletas
    FROM bicicleta
    GROUP BY id_punto_alquiler
) t ON t.id_punto_alquiler = c.id_punto_alquiler
WHERE c.capacidad_total < t.total_bicicletas;

