----------------------
--ASIGNAR COBERTURA A BICICLETA
--------------------------------
    id_bicicleta,
    id_tipo_cobertura,
    monto_maximo,
    fecha_inicio_vigencia,
    fecha_fin_vigencia,
    estado
)
SELECT
    b.id_bicicleta,
    CASE 
        WHEN b.id_bicicleta % 100 < 40 THEN 1   -- 40% Básica
        WHEN b.id_bicicleta % 100 < 70 THEN 2   -- 30% Estándar
        WHEN b.id_bicicleta % 100 < 85 THEN 3   -- 15% Premium
        WHEN b.id_bicicleta % 100 < 93 THEN 4   -- 8% Resp. Civil
        WHEN b.id_bicicleta % 100 < 98 THEN 5   -- 5% Mantenimiento
        ELSE 6                                  -- 2% Multirriesgo
    END AS id_tipo_cobertura,
    CASE 
        WHEN b.id_bicicleta % 100 < 40 THEN 300.00      -- Básica
        WHEN b.id_bicicleta % 100 < 70 THEN 600.00      -- Estándar
        WHEN b.id_bicicleta % 100 < 85 THEN 1200.00     -- Premium
        WHEN b.id_bicicleta % 100 < 93 THEN 5000.00     -- Resp. Civil
        WHEN b.id_bicicleta % 100 < 98 THEN 2000.00     -- Mantenimiento
        ELSE 2000.00                                    -- Multirriesgo
    END AS monto_maximo,
    CAST(GETDATE() AS DATE) AS fecha_inicio_vigencia,
    NULL AS fecha_fin_vigencia,
    'activo' AS estado
FROM bicicleta b;

------------------------
--CONDICIONES ESPECIALES
------------------------

    id_bicicleta,
    tipo_condicion,
    valor_minimo,
    valor_maximo,
    unidad_medida,
    descripcion
)
SELECT
    b.id_bicicleta,
    CASE 
        WHEN b.id_bicicleta % 7 = 0 THEN 'peso_maximo'
        WHEN b.id_bicicleta % 7 = 1 THEN 'altura_minima'
        WHEN b.id_bicicleta % 7 = 2 THEN 'altura_maxima'
        WHEN b.id_bicicleta % 7 = 3 THEN 'edad_minima'
        WHEN b.id_bicicleta % 7 = 4 THEN 'experiencia_minima'
        WHEN b.id_bicicleta % 7 = 5 THEN 'licencia_requerida'
        ELSE 'otro'
    END AS tipo_condicion,
    -- Valor mínimo según tipo
    CASE 
        WHEN b.id_bicicleta % 7 = 0 THEN 70      -- peso_maximo: 70
        WHEN b.id_bicicleta % 7 = 1 THEN 140     -- altura_minima: 140
        WHEN b.id_bicicleta % 7 = 2 THEN 180     -- altura_maxima: 180
        WHEN b.id_bicicleta % 7 = 3 THEN 8       -- edad_minima: 8
        WHEN b.id_bicicleta % 7 = 4 THEN 1       -- experiencia_minima: 1
        ELSE NULL
    END AS valor_minimo,
    -- Valor máximo según tipo
    CASE 
        WHEN b.id_bicicleta % 7 = 0 THEN 150     -- peso_maximo: 150
        WHEN b.id_bicicleta % 7 = 1 THEN 180     -- altura_minima: 180
        WHEN b.id_bicicleta % 7 = 2 THEN 220     -- altura_maxima: 220
        WHEN b.id_bicicleta % 7 = 3 THEN 18      -- edad_minima: 18
        WHEN b.id_bicicleta % 7 = 4 THEN 12      -- experiencia_minima: 12
        ELSE NULL
    END AS valor_maximo,
    -- Unidad de medida
    CASE 
        WHEN b.id_bicicleta % 7 = 0 THEN 'kg'
        WHEN b.id_bicicleta % 7 = 1 THEN 'cm'
        WHEN b.id_bicicleta % 7 = 2 THEN 'cm'
        WHEN b.id_bicicleta % 7 = 3 THEN 'anos'
        WHEN b.id_bicicleta % 7 = 4 THEN 'meses'
        ELSE NULL
    END AS unidad_medida,
    -- Descripción
    CASE 
        WHEN b.id_bicicleta % 7 = 0 THEN 'Limite de peso maximo para la bicicleta'
        WHEN b.id_bicicleta % 7 = 1 THEN 'Altura minima recomendada'
        WHEN b.id_bicicleta % 7 = 2 THEN 'Altura maxima recomendada'
        WHEN b.id_bicicleta % 7 = 3 THEN 'Edad minima recomendada para usar'
        WHEN b.id_bicicleta % 7 = 4 THEN 'Experiencia minima requerida'
        WHEN b.id_bicicleta % 7 = 5 THEN 'Se requiere licencia de identificacion'
        ELSE 'Otra condicion especial'
    END AS descripcion
FROM bicicleta b
WHERE b.id_bicicleta % 10 < 7;  -- Solo 70% de bicicletas (determinístico, igual que antes)
