    id_bicicleta,
    km_total,
    horas_total,
    km_parcial,
    horas_parcial,
    fecha_ultimo_mantenimiento,
    id_admin
)
SELECT
    b.id_bicicleta,
    -- km_total: 0 a 5000, distribuido por edad
    CAST((b.id_bicicleta % 501) * 10 + (b.anio_fabricacion - 2019) * 200 AS DECIMAL(10,2)) AS km_total,
    -- horas_total: proporcional a km (1 hora cada 20 km aprox)
    CAST(((b.id_bicicleta % 501) * 10 + (b.anio_fabricacion - 2019) * 200) / 20 AS DECIMAL(10,2)) AS horas_total,
    -- km_parcial: 0-30% del total (desde último mantenimiento)
    CAST(((b.id_bicicleta % 501) * 10 + (b.anio_fabricacion - 2019) * 200) * (b.id_bicicleta % 31) / 100 AS DECIMAL(10,2)) AS km_parcial,
    -- horas_parcial: 0-30% del total
    CAST((((b.id_bicicleta % 501) * 10 + (b.anio_fabricacion - 2019) * 200) / 20) * (b.id_bicicleta % 31) / 100 AS DECIMAL(10,2)) AS horas_parcial,
    -- fecha_ultimo_mantenimiento: entre 30 y 365 días atrás
    DATEADD(DAY, -(30 + (b.id_bicicleta % 335)), CAST(GETDATE() AS DATE)),
    -- id_admin: distribuido entre 2001-2005
    2001 + (b.id_bicicleta % 5)
FROM bicicleta b;

