    CASE 
        WHEN b.id_tipo_asistencia = 2 THEN 1  -- Eléctrica
        WHEN b.id_tipo_uso = 1 THEN 18        -- Terreno Montañoso
        WHEN b.id_tipo_uso = 2 THEN 19        -- Para Ciudad
        WHEN b.id_tipo_uso = 3 THEN 20        -- Para Ruta Larga
        ELSE (2 + (b.id_bicicleta % 18))      -- Otras aleatorias
    END AS id_etiqueta,
    CAST(GETDATE() AS DATE),
    NULL,
    2001 + (b.id_bicicleta % 5)
FROM bicicleta b
WHERE b.id_bicicleta % 10 < 4;  -- 40% de bicicletas (determinístico)

