-- FOTOS DE PUNTOS DE ALQUILER (2 por punto = 260)
SELECT
    'foto_punto_' + CAST(pa.id_punto_alquiler AS VARCHAR) + '_' + CAST(ROW_NUMBER() OVER (PARTITION BY pa.id_punto_alquiler ORDER BY pa.id_punto_alquiler) AS VARCHAR) + '.jpg' AS nombre_archivo,
    '/images/puntos/punto_' + CAST(pa.id_punto_alquiler AS VARCHAR) + '_v' + CAST(ROW_NUMBER() OVER (PARTITION BY pa.id_punto_alquiler ORDER BY pa.id_punto_alquiler) AS VARCHAR) + '.jpg' AS ruta_archivo,
    'jpg' AS formato,
    1920 AS ancho_px,
    1080 AS alto_px,
    CASE WHEN ROW_NUMBER() OVER (PARTITION BY pa.id_punto_alquiler ORDER BY pa.id_punto_alquiler) = 1 THEN 1 ELSE 0 END AS es_principal,
    ROW_NUMBER() OVER (PARTITION BY pa.id_punto_alquiler ORDER BY pa.id_punto_alquiler) - 1 AS orden,
    'Fotografia de punto de alquiler ' + CAST(pa.id_punto_alquiler AS VARCHAR) AS descripcion,
    'activo' AS estado,
    'punto_alquiler' AS tipo_fotografia
FROM punto_alquiler pa
CROSS JOIN (SELECT 1 AS n UNION ALL SELECT 2) AS num
WHERE num.n <= 2

UNION ALL

-- FOTOS DE BICICLETAS (1-2 por bicicleta = ~16500)
SELECT
    'foto_bici_' + CAST(b.id_bicicleta AS VARCHAR) + '_' + CAST(ROW_NUMBER() OVER (PARTITION BY b.id_bicicleta ORDER BY b.id_bicicleta) AS VARCHAR) + '.jpg' AS nombre_archivo,
    '/images/bicis/bici_' + CAST(b.id_bicicleta AS VARCHAR) + '_v' + CAST(ROW_NUMBER() OVER (PARTITION BY b.id_bicicleta ORDER BY b.id_bicicleta) AS VARCHAR) + '.jpg' AS ruta_archivo,
    'jpg' AS formato,
    1200 AS ancho_px,
    800 AS alto_px,
    CASE WHEN ROW_NUMBER() OVER (PARTITION BY b.id_bicicleta ORDER BY b.id_bicicleta) = 1 THEN 1 ELSE 0 END AS es_principal,
    ROW_NUMBER() OVER (PARTITION BY b.id_bicicleta ORDER BY b.id_bicicleta) - 1 AS orden,
    'Fotografia de bicicleta ' + CAST(b.id_bicicleta AS VARCHAR) AS descripcion,
    'activo' AS estado,
    'bicicleta' AS tipo_fotografia
FROM bicicleta b
CROSS JOIN (SELECT 1 AS n UNION ALL SELECT 2) AS num
WHERE num.n <= CASE WHEN b.id_bicicleta % 3 = 0 THEN 2 ELSE 1 END;

