-- ============================================================================
-- SCRIPT 1 (CORREGIDO): INSERT MASIVO DE RESERVA (cabecera)
-- ============================================================================
-- Insertar una o dos reservas por cliente
-- Clientes: 1-2000
-- Métodos de pago: rotar entre 1-10
-- Rutas: algunas con ruta turística, otras sin
-- Estados: variados
-- Fechas: SIEMPRE hoy o en el futuro (para no romper el trigger)

    id_cliente, id_metodo_de_pago, fecha_inicio, fecha_fin,
    id_ruta, estado
)
SELECT
    c.id_cliente,
    -- Método de pago rotativo (1-10)
    1 + ((c.id_cliente - 1) % 10) AS id_metodo_de_pago,
    -- Fecha inicio: entre hoy y +30 días
    CAST(DATEADD(DAY, (c.id_cliente % 31), CAST(GETDATE() AS DATE)) AS DATE) AS fecha_inicio,
    -- Fecha fin: inicio + 1-7 días
    CAST(DATEADD(DAY, 1 + (c.id_cliente % 7),
                 DATEADD(DAY, (c.id_cliente % 31), CAST(GETDATE() AS DATE))
         ) AS DATE) AS fecha_fin,
    -- Ruta turística: solo si id_cliente % 3 == 0 (33% con ruta)
    CASE WHEN c.id_cliente % 3 = 0 THEN 1 + ((c.id_cliente - 1) % 90) ELSE NULL END AS id_ruta,
    -- Estados: mayormente pendiente, algunos confirmada
    CASE 
        WHEN c.id_cliente % 5 = 0 THEN 'confirmada'
        ELSE 'pendiente'
    END AS estado
FROM cliente c
WHERE c.id_cliente BETWEEN 1 AND 2000

UNION ALL

-- Segunda reserva para algunos clientes (id_cliente % 2 == 0 = 50%)
SELECT
    c.id_cliente,
    1 + ((c.id_cliente + 1) % 10) AS id_metodo_de_pago,
    -- Fecha inicio: entre hoy y +45 días (distinta a la primera)
    CAST(DATEADD(DAY, 5 + ((c.id_cliente + 100) % 40), CAST(GETDATE() AS DATE)) AS DATE) AS fecha_inicio,
    -- Fecha fin: inicio + 2-8 días
    CAST(DATEADD(DAY, 2 + ((c.id_cliente + 100) % 7),
                 DATEADD(DAY, 5 + ((c.id_cliente + 100) % 40), CAST(GETDATE() AS DATE))
         ) AS DATE) AS fecha_fin,
    CASE WHEN (c.id_cliente + 1) % 3 = 0 THEN 1 + ((c.id_cliente + 1) % 90) ELSE NULL END AS id_ruta,
    CASE 
        WHEN (c.id_cliente + 1) % 5 = 0 THEN 'confirmada'
        ELSE 'pendiente'
    END AS estado
FROM cliente c
WHERE c.id_cliente BETWEEN 1 AND 2000
  AND c.id_cliente % 2 = 0;  -- Solo clientes pares
