-- ====================================================================
-- SCRIPT 2 (MEJORADO): DESCUENTOS EN ~10% DE RESERVAS CONFIRMADAS
-- ====================================================================

;WITH ReservasConfirmadas AS (
    SELECT 
        r.id_reserva,
        r.estado,
        ROW_NUMBER() OVER (ORDER BY r.id_reserva) AS rn,
        COUNT(*) OVER () AS total_confirmadas
    FROM reserva r
    WHERE r.estado = 'confirmada'
),
ReservasConDescuento AS (
    SELECT
        id_reserva
    FROM ReservasConfirmadas
    WHERE rn <= total_confirmadas * 0.10   -- 10% de las confirmadas
)
SELECT
    rcd.id_reserva,
    CASE 
        WHEN rcd.id_reserva % 20 < 5 THEN 1  -- Estudiante 10%
        WHEN rcd.id_reserva % 20 < 8 THEN 2  -- Jubilado 15%
        WHEN rcd.id_reserva % 20 < 11 THEN 3 -- Discapacitado 20%
        WHEN rcd.id_reserva % 20 < 14 THEN 6 -- Grupo 12%
        ELSE 9                               -- Cupón $5
    END AS id_descuento,
    CASE 
        WHEN rcd.id_reserva % 20 < 5 THEN 15.00   -- ~10% estimado
        WHEN rcd.id_reserva % 20 < 8 THEN 22.50   -- ~15%
        WHEN rcd.id_reserva % 20 < 11 THEN 30.00  -- ~20%
        WHEN rcd.id_reserva % 20 < 14 THEN 18.00  -- ~12%
        ELSE 5.00                                 -- Cupón fijo
    END AS monto_descontado
FROM ReservasConDescuento rcd;
--------------------------------
--DETALLE ALQUILER---
-------------------------------
-- Versión segura: asignar bicicletas existentes de forma rotativa
    id_reserva, id_bicicleta, id_plan, id_tarifa,
    tarifa_unitaria, cantidad_unidades,
    subtotal, porcentaje_iva, iva_total, total_item,
    fecha_inicio, fecha_fin
)
SELECT
    r.id_reserva,
    b.id_bicicleta,                                -- SIEMPRE existe
    1 + ((r.id_reserva + row_num.n) % 5) AS id_plan,
    1 + ((r.id_reserva + row_num.n) % 100) AS id_tarifa,
    CASE 
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 1 THEN 5.00
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 2 THEN 35.00
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 3 THEN 150.00
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 4 THEN 500.00
        ELSE 5000.00
    END AS tarifa_unitaria,
    CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END AS cantidad_unidades,
    -- Subtotal = tarifa * cantidad
    CASE 
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 1 THEN 5.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 2 THEN 35.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 3 THEN 150.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 4 THEN 500.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        ELSE 5000.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
    END AS subtotal,
    19.00 AS porcentaje_iva,
    -- IVA total
    (CASE 
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 1 THEN 5.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 2 THEN 35.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 3 THEN 150.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 4 THEN 500.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        ELSE 5000.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
    END) * 0.19 AS iva_total,
    -- Total item = subtotal + iva
    (CASE 
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 1 THEN 5.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 2 THEN 35.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 3 THEN 150.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        WHEN (1 + ((r.id_reserva + row_num.n) % 5)) = 4 THEN 500.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
        ELSE 5000.00 * CASE WHEN row_num.n % 10 = 0 THEN 2 ELSE 1 END
    END) * 1.19 AS total_item,
    CAST(r.fecha_inicio AS DATETIME),
    CAST(r.fecha_fin AS DATETIME)
FROM reserva r
CROSS JOIN (SELECT 1 AS n UNION ALL SELECT 2) AS row_num
JOIN (
    -- Bicicletas numeradas para repartirlas de forma circular
    SELECT 
        id_bicicleta,
        ROW_NUMBER() OVER (ORDER BY id_bicicleta) AS rn
    FROM bicicleta
) b
    ON b.rn = 1 + ((r.id_reserva * 2 + row_num.n) % (
            SELECT COUNT(*) FROM bicicleta
        ))
WHERE row_num.n <= CASE WHEN r.id_cliente % 5 = 0 THEN 2 ELSE 1 END;
