-- ============================================================================
-- SCRIPT 1: INSERT MASIVO DE GUIA_IDIOMA (CORREGIDO)
-- ============================================================================

SELECT
    g.id_guia,
    -- Idioma asignado según el “slot” 1,2,3
    CASE idioma_num.id
        WHEN 1 THEN 1 + ((g.id_guia - 2500) % 30)          -- idioma base
        WHEN 2 THEN 1 + ((g.id_guia - 2500 + 10) % 30)     -- segundo idioma
        WHEN 3 THEN 1 + ((g.id_guia - 2500 + 20) % 30)     -- tercer idioma
    END AS id_idioma,
    -- Estado de la asignación
    CASE 
        WHEN g.id_guia % 10 = 0 THEN 'inactivo' 
        ELSE 'activo' 
    END AS estado
FROM 
    -- Slots de idioma (1 a 3)
    (VALUES (1), (2), (3)) AS idioma_num(id)
CROSS JOIN
    -- Guías existentes
    (SELECT id_guia 
     FROM guia_turistico 
     WHERE id_guia BETWEEN 2500 AND 2599) AS g
WHERE
    -- 60% con 1 idioma, 30% con 2, 10% con 3
    idioma_num.id <= CASE 
        WHEN g.id_guia % 100 < 60 THEN 1
        WHEN g.id_guia % 100 < 90 THEN 2
        ELSE 3
    END;
---------------------------
--ASIGNAR RUTAS AGUIAS
----------------------------

-- ============================================================================
-- SCRIPT 2: INSERT MASIVO DE GUIA_RUTA
-- ============================================================================
-- Asignar 1-2 rutas a cada guía (100 guías del 2500-2599)
-- Rutas disponibles: 1-90
-- veces_realizada: 0-100 (varía según guía y ruta)
-- Estados: mayoría 'activo', algunos 'inactivo', muy pocos 'suspendido'

SELECT
    g.id_guia,
    -- Ruta 1: asignada a todos (rotativa)
    CASE 
        WHEN ruta_num.n = 1 THEN 1 + ((g.id_guia - 2500) % 90)
        WHEN ruta_num.n = 2 THEN 1 + ((g.id_guia - 2500 + 45) % 90)
        ELSE 1
    END AS id_ruta,
    -- Veces realizada: según guía y ruta (0-100)
    -- Guías más antiguas (2500+) tienen más experiencia
    (g.id_guia - 2500) * 10 + (ruta_num.n * 5) AS veces_realizada,
    -- Estado: 85% activo, 10% inactivo, 5% suspendido
    CASE 
        WHEN g.id_guia % 100 < 5 THEN 'suspendido'
        WHEN g.id_guia % 100 < 15 THEN 'inactivo'
        ELSE 'activo'
    END AS estado
FROM
    (SELECT 1 AS n UNION ALL SELECT 2) AS ruta_num,
    (SELECT id_guia FROM guia_turistico WHERE id_guia BETWEEN 2500 AND 2599) AS g
WHERE
    -- 70% de guías con 1 ruta, 30% con 2 rutas
    ruta_num.n <= CASE WHEN g.id_guia % 10 < 7 THEN 1 ELSE 2 END;
--------------------------------
--RESEÑAS MASIVA
--------------------------------

-- ============================================================================
-- SCRIPT: INSERT MASIVO DE RESENIA_RUTA
-- ============================================================================
-- Reseñas SOLO para clientes que hayan tomado rutas en reservas
-- Una reseña por reserva que tenga id_ruta NOT NULL
-- Calificaciones variadas (1-5) con algunos NULL (sin calificar)
-- Comentarios variados
-- ~60% activas, ~40% eliminadas (moderación)

SELECT
    r.id_reserva,
    r.id_ruta,                    -- La ruta que se tomó en la reserva
    r.id_cliente,                 -- Cliente que tomó la reserva
    -- Calificación: 70% con nota (1-5), 30% sin calificar (NULL)
    CASE 
        WHEN r.id_reserva % 10 < 7 THEN 1 + ((r.id_reserva + r.id_cliente) % 5)
        ELSE NULL
    END AS calificacion,
    -- Comentario variado según calificación
    CASE 
        WHEN r.id_reserva % 10 < 7 THEN 
            CASE 
                WHEN (1 + ((r.id_reserva + r.id_cliente) % 5)) = 5 
                    THEN 'Excelente experiencia, muy recomendado. Guía profesional y atento.'
                WHEN (1 + ((r.id_reserva + r.id_cliente) % 5)) = 4 
                    THEN 'Muy buena ruta, paisajes hermosos. Algo podría mejorar en la puntualidad.'
                WHEN (1 + ((r.id_reserva + r.id_cliente) % 5)) = 3 
                    THEN 'Ruta interesante, nada extraordinario. Esperaba más claridad en las explicaciones.'
                WHEN (1 + ((r.id_reserva + r.id_cliente) % 5)) = 2 
                    THEN 'Ruta regular. Faltó información y el guía no fue muy comunicativo.'
                ELSE 'No recomendable. Mala experiencia general, varias cosas no salieron como se esperaba.'
            END
        ELSE NULL
    END AS comentario,
    -- Estado: mayoría activas, algunas eliminadas (moderación)
    CASE 
        WHEN r.id_reserva % 10 >= 6 THEN 'eliminado'
        ELSE 'activo'
    END AS estado
FROM reserva r
WHERE 
    r.id_ruta IS NOT NULL          -- Solo reservas con ruta asignada
    AND r.estado IN ('confirmada', 'completada', 'en_progreso');  -- Solo estados válidos
