-- ============================================================================
-- SCRIPT 1: INSERT MASIVO DE FOTOGRAFIA TIPO RUTA
-- ============================================================================
-- ~200-300 fotos para rutas (2-3 fotos por ruta aproximadamente)
-- El trigger automáticamente crea filas en foto_ruta con id_ruta asignado

    nombre_archivo, ruta_archivo, formato,
    ancho_px, alto_px, es_principal, orden,
    descripcion, estado, tipo_fotografia
)
SELECT
    'foto_ruta_' + CAST(r.id_ruta AS VARCHAR) + '_' + 
    CAST(foto_num.n AS VARCHAR) + '.jpg' AS nombre_archivo,
    '/images/rutas/ruta_' + CAST(r.id_ruta AS VARCHAR) + 
    '_v' + CAST(foto_num.n AS VARCHAR) + '.jpg' AS ruta_archivo,
    'jpg' AS formato,
    1920 AS ancho_px,
    1080 AS alto_px,
    CASE WHEN foto_num.n = 1 THEN 1 ELSE 0 END AS es_principal,
    foto_num.n - 1 AS orden,
    'Fotografía de ruta ' + CAST(r.id_ruta AS VARCHAR) + 
    ' - vista ' + CAST(foto_num.n AS VARCHAR) AS descripcion,
    'activo' AS estado,
    'ruta' AS tipo_fotografia
FROM ruta_turistica r
CROSS JOIN (SELECT 1 AS n UNION ALL SELECT 2 UNION ALL SELECT 3) AS foto_num
WHERE foto_num.n <= CASE 
    WHEN r.id_ruta % 4 = 0 THEN 3  -- 25% con 3 fotos
    WHEN r.id_ruta % 4 = 1 THEN 2  -- 25% con 2 fotos
    ELSE 2                           -- 50% con 2 fotos
END;
