-- ============================================================================
-- SCRIPT 2: INSERT MASIVO DE FOTOGRAFIA TIPO RESENIA
-- ============================================================================
-- Una o dos fotos por reseña (solo de reseñas existentes)
-- El trigger automáticamente crea filas en foto_resenia

    nombre_archivo, ruta_archivo, formato,
    ancho_px, alto_px, es_principal, orden,
    descripcion, estado, tipo_fotografia
)
SELECT
    'foto_resenia_' + CAST(rr.id_resenia_ruta AS VARCHAR) + '_' + 
    CAST(foto_num.n AS VARCHAR) + '.jpg' AS nombre_archivo,
    '/images/resenias/resenia_' + CAST(rr.id_resenia_ruta AS VARCHAR) + 
    '_v' + CAST(foto_num.n AS VARCHAR) + '.jpg' AS ruta_archivo,
    'jpg' AS formato,
    1200 AS ancho_px,
    900 AS alto_px,
    CASE WHEN foto_num.n = 1 THEN 1 ELSE 0 END AS es_principal,
    foto_num.n - 1 AS orden,
    'Foto de reseña ' + CAST(rr.id_resenia_ruta AS VARCHAR) AS descripcion,
    'activo' AS estado,
    'resenia' AS tipo_fotografia
FROM resenia_ruta rr
CROSS JOIN (SELECT 1 AS n UNION ALL SELECT 2) AS foto_num
WHERE 
    -- Solo 60% de reseñas tienen fotos (no todas)
    rr.id_resenia_ruta % 10 < 6
    AND foto_num.n <= CASE 
        WHEN rr.id_resenia_ruta % 5 = 0 THEN 2  -- 20% con 2 fotos
        ELSE 1                                     -- 80% con 1 foto
    END;
