-- ============================================================================
-- SCRIPT 3: UPDATE PARA LLENAR tipo_foto EN foto_ruta
-- ============================================================================
-- Asignar tipos de foto a los registros que tienen NULL

UPDATE foto_ruta
SET 
    tipo_foto = CASE 
        WHEN id_fotografia % 7 = 0 THEN 'principal'
        WHEN id_fotografia % 7 = 1 THEN 'paisaje'
        WHEN id_fotografia % 7 = 2 THEN 'punto_interes'
        WHEN id_fotografia % 7 = 3 THEN 'sendero'
        WHEN id_fotografia % 7 = 4 THEN 'dificultad'
        WHEN id_fotografia % 7 = 5 THEN 'fauna'
        ELSE 'flora'
    END,
    temporada = CASE 
        WHEN id_fotografia % 4 = 0 THEN 'primavera'
        WHEN id_fotografia % 4 = 1 THEN 'verano'
        WHEN id_fotografia % 4 = 2 THEN 'otoño'
        ELSE 'invierno'
    END,
    punto_interes = CASE 
        WHEN id_fotografia % 3 = 0 THEN 'Cascada principal'
        WHEN id_fotografia % 3 = 1 THEN 'Mirador panorámico'
        ELSE 'Área de descanso'
    END
WHERE tipo_foto IS NULL;
